documentation:
Get accessors are called when a property is read, and therefore cannot take any
parameters, so the following is invalid:

```ts
class A {
  get value(cached: boolean) {}
}
```

fixes.body:
Remove any parameters from the get accessor:

```ts
class A {
  get value() {}
}
```

If you really need to provide additional information when getting a value, you
should just use a method:

```ts
class A {
  getValue(cached: boolean) {}
}
```
